import React from 'react'


const Card3 = ({name, model, manufacturer, length, crew, hyperdrive_rating}) => {
    return (
        <div className="dib bg-light-red ma3 pa3 shadow=5 br3">

        <h1>{name}</h1>
        <p>Model: {model}</p>   
        <p>Manufacturer: {manufacturer}</p>   
        <p>Length: {length}</p>   
        <p>Crew: {crew}</p>   
        <p>Hyperdrive Rating: {hyperdrive_rating}</p>       
        </div>
    )
};

export default Card3
